import React from "react";

export default function NavBar()
{
    let navStyle = {
        display: "flex",
        maxHeight: "90px",
        contentJustify: "space-between",

    }
    let divStyle = {
        display: "flex",
        // flexDirection: "row-reverse",
        // float: "right",
    }
    return (
        <nav style = {navStyle}>
            <img className = "nav--logo" src="" alt="Logo"/>
            <div style={divStyle}>
                <h3>Blogs</h3>
                <h3>Contacts</h3>
                <h3>About</h3>
            </div>

        </nav>
    )
}
